import React from 'react'
import '.Card.css';
import pokemons from './data';
import Pokemon from './Pokemon';

class Card extends React.Component {
    render() {
    return (<div className='card'>
        { pokemons.map((pokemon) => <Pokemon pokemonData={pokemon} key={pokemon.name}/>) }
        </div>)
    }
}

export default Card;
